	add("typhoon", "{\"term\":\"typhoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\", \"ancient greek (to 1453)\", \"Hindi\", \"yue chinese\", \"Chinese\"], \"text\":\"Its ultimate origin is generally thought to be Chinese {{zh-l|大風|big wind}}, Yue chinese \u0027daai6 fung1\u0027. It entered English as early as 1588,\u0026lt;ref\u0026gt;Thomas Hickock\u0027s translation of \u0027The voyage and trauell of M. Caesar Fredericke, Marchant of Venice, into the East India, and beyond the Indies\u0027: \u0026quot;concerning which Touffon ye are to vnderstand, that in the East Indies often times, there are not stormes as in other countreys; but euery 10. or 12. yeeres there are such tempests and stormes, that it is a thing incredible, but to those that haue seene it, neither do they know certainly what yeere they wil come.\u0026quot; ({{R:Etymonline}})\u0026lt;/ref\u0026gt; perhaps via Portuguese {{m|pt|tufão}} (attested since at least 1560)\u0026lt;ref name\u003d\u0026quot;Hirth\u0026quot;\u0026gt;Frederick Hirth, \u0027The word \u0026quot;Typhoon,\u0026quot; its history and origin\u0027, in \u0027The Journal of the Royal Geographical Society\u0027 (1880), discusses the presence of words with roughly this sound and meaning in Chinese, Arabic, Persian, Hindi and Greek — and uncertainty about which language it derives from — and notes the early Portuguese attestation.\u0026lt;/ref\u0026gt; from Arabic \u0027طُوفَان\u0027 (compare Hindi \u0027तूफ़ान\u0027 (tr\u003dtūfān) Persian \u0027توفان\u0027 (tr\u003dtufân) .\u0026lt;ref name\u003d\u0026quot;Cannon\u0026quot;\u0026gt;\u0027The Arabic Contributions to the English Language: An Historical Dictionary\u0027 by Garland Hampton Cannon and Alan S. Kaye considers \u0027typhoon\u0027 \u0026quot;a special case, transmitted by Cantonese, from Arabic, but ultimately deriving from Greek. [...] The Chinese applied the [Greek] concept to a rather different wind [...]\u0026quot;\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Andrew Delahunty, \u0027From Bonbon to Cha-cha: Oxford Dictionary of Foreign Words and Phrases\u0027\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Tai Whan Kim, \u0027The Portuguese Element in Japanese: A Critical Survey\u0027 (1976): several points suggest that the Portuguese word came from the Arabic, not from Chinese tai-fung ...\u0026lt;/ref\u0026gt; Within English, its form was influenced by Ancient greek (to 1453) \u0027τυφῶν\u0027 (lang\u003dgrc) \u0026lt;ref\u0026gt;F. Corriente \u0027Dictionary of Arabic and Allied Loanwords. Spanish, Portuguese, Catalan, Galician and Kindred Dialects\u0027 (2008), page 457a: tifò (Ct.), tifón (Cs.) and tufão (Pt.): was prob. first acquired by Pt. during the initial explorations of the Indian Ocean, \u0026lt; Ar. ṭūfān \u0026quot;flood; hurricane\u0026quot;, and phonetically contaminated by Gr. typhṓn, name of the mythical monster causing volcano eruptions and hurricanes.\u0026lt;/ref\u0026gt; (Some sources suggest the term originated in Greek and travelled via Arabic to Chinese before making its way back to Europe,\u0026lt;ref name\u003d\u0026quot;Cannon\u0026quot;/\u0026gt; but this is implausible.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A weather phenomenon in the Eastern Pacific that is precisely equivalent to a hurricane, which results in wind speeds of 64 knots (118km/h) or above. Equivalent to a cyclone in the Indian Ocean and Indonesia/Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"World War II aircraft, Hawker typhoon\", \"priority\":2}]}, \"synonyms\":{}}");

